import { FETCH_ALL, CREATE, UPDATE, DELETE } from '../constants/actionTypes';
import * as api from '../api';

// Action Creators
export const getRevenue = () => async (dispatchRevenue) => {
    try {
        const { data } = await api.fetchRevenue();

        dispatchRevenue({ type: FETCH_ALL, payload: data });
    } catch (error) {
        console.log(api.fetchRevenue())
        console.log(error.message);
    }
}
